import React from 'react'

const NavSVG = <svg class="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M9 5l7 7-7 7"></path></svg>

const Nav = () => {
    return (
        <div className='fixed bg-gray-800 z-20 flex items-center h-14 px-8 w-full'>
            <div className='text-white text-base font-bold'>StageLink</div>
            {NavSVG}
        </div>
    )
}

export default Nav
